import './App.css';

function App() {
  return (
    <div className="App">
      <div className="Datos">
          <label>user_handle<input></input></label>
          <label>first_name <input></input></label>
          <label>last_name <input></input></label>
          <label>phonenumber <input></input></label>
          <button>Registrar</button>
      </div>
    </div>
  );
}

export default App;
